import Cards from '../../../../../rick_and_morty/Client/src/components/cards/Cards';


function App() {
  return (
    <main className={style.app}>

      {path !== '/'&& <Nav/>}


      <Routes>

      <Route
        path='/' element={<Landing/>} 
      />

      <Route
        path='/about' element={<About/>} 
      />

      <Route
        path='/home' element={<Cards/>} 
      />

      <Route
        path='/detail/:id' element={<Detail/>} 
      />

      <Route
        path='/create' element={<Create/>} 
      />

      </Routes>
    </main>
  );
}

export default App;
